Withdraw character#characterId to to using the nonce, expires and the proof. Emits the Withdraw event. *Proof is the signature from someone with the ADMIN_ROLE. The message to sign is the packed data of this contract's address, characterId, nonce and expires. Here's an example to generate a proof: digest = ethers.utils.arrayify(
ethers.utils.solidityKeccak256(
["address", "uint256", "uint256", "uint256"],
[newbieVilla.address, characterId, nonce, expires]
)
);
proof = await owner.signMessage(digest); Requirements: : expires is greater than the current timestamp proof is signed by the one with the ADMIN_ROLE* function withdraw(address to, uint256 characterId, uint256 nonce, uint256 expires, bytes calldata proof) external notExpired(expires); Parameters Name Type Description to address Receiver of the withdrawn character. characterId uint256 The token id of the character to withdraw. nonce uint256 Random nonce used to generate the proof. expires uint256 Expire time of the proof, Unix timestamp in seconds. proof bytes The proof using to withdraw the character.
